curl -XPOST 'http://localhost:9200/electronic_products/_create/1302' -H 'Content-Type: application/json' -d '{"product_name": "SGM8301/SGM8302/SGM8304", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The  SGM8301  (single),  SGM8302  (dual)  and  SGM8304 (quad) are high speed operational amplifiers.  These devices can operate from 4.5V to 12V single  supply or from ±2.25V to ±6V dual supplies while  consuming only 8.5mA quiescent current per amplifier.  The SGM8301/2/4 provide wide input common mode  voltage range and rail-to-rail output swing.  The SGM8301/2/4 have excellent video performance.  They exhibit a -0.1dB gain flatness of 56MHz (G = +2), a  -3dB bandwidth of 100MHz, and a 155V/µs slew rate.  The SGM8301 is available in Green SOT-23-5,  MSOP-8 and SOIC-8 packages. The SGM8302 is  available in Green SOIC-8 and MSOP-8 packages. The  SGM8304 is available in Green SOIC-14 and  TSSOP-14 packages. They are specified over the  extended -40℃ to +85℃ temperature range.    "}'
